import React, { useState } from "react";
import { BrowserRouter as Router, Routes, Route, Link } from "react-router-dom";
import Museums from "./components/Museums";
import About from "./components/About";
import Home from "./components/Home";
import ChatBot from "./components/ChatBot";

function App() {
  const [showChatBot, setShowChatBot] = useState(false);

  const handleOpenChat = () => {
    setShowChatBot(true);
  };

  return (
    <Router>
      <div>
        <nav className="flex justify-between items-center bg-green-700 text-white p-4">
          <div className="text-2xl font-bold">PEAS</div>
          <div className="space-x-4">
            <Link to="/">Home</Link>
            <Link to="/museums">Museums</Link>
            <Link to="/about">About</Link>
            <button onClick={() => setShowChatBot(true)}>Chat</button>
          </div>
        </nav>

        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/museums" element={<Museums onBookTicket={handleOpenChat} />} />
          <Route path="/about" element={<About />} />
        </Routes>

        {showChatBot && (
          <div className="fixed bottom-4 right-4">
            <ChatBot />
          </div>
        )}
      </div>
    </Router>
  );
}

export default App;
